indexWeapon = 0
indexPattern = 1
lastIndexWeapon = 0

flag = 0
activate = 1
timestart = 0
Wpattern = { ak47, galil, sg553, m4a1, m4a4, famas, aug }
Wkey = { ak47key, galilkey, sg553key, m4a1key, m4a4key, famaskey, augkey }
function OnEvent(event, arg)
    OutputLogMessage("\nEvent: " .. event .. " Arg: " .. arg .. " Activate: " .. activate .. "\n")
    --Hold the left mouse button
    if (event == "MOUSE_BUTTON_RELEASED") then
        indexPattern = 1
    end
    if (event == "MOUSE_BUTTON_PRESSED") then
        OutputLogMessage("\nMOUSE_BUTTON_PRESSED")
        EnablePrimaryMouseButtonEvents(true)
        if (IsModifierPressed("alt")) then
            indexWeapon = 7
            lastIndexWeapon = indexWeapon
            OutputLogMessage("\n AUG")
        end
        if (arg == offkey) then
            if(activate == 1) then
                OutputLogMessage("\n OFF")
                activate = 0
            end
            if (activate == 0 and IsModifierPressed("ctrl")) then
                indexWeapon = lastIndexWeapon
                OutputLogMessage("\n ON")
                activate = 1
            end
        elseif (arg > 2) then
            ClearLog()
            activate = 1
            if(arg==Wkey[1] and not IsModifierPressed("ctrl") and not IsModifierPressed("alt")) then
                indexWeapon=1
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n AK47")
            end
            if (arg == Wkey[2] and IsModifierPressed("ctrl")) then
                indexWeapon = 2
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n GALIL")
            end
            if(arg==Wkey[3] and IsModifierPressed("alt")) then
                indexWeapon=3
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n SG553")
            end
            if(arg==Wkey[4] and not IsModifierPressed("ctrl") and not IsModifierPressed("alt")) then
                indexWeapon=4
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n M4A1")
            end
            if (arg == Wkey[5] and IsModifierPressed("ctrl")) then
                indexWeapon = 5
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n M4A4")
            end
            if (arg == Wkey[6] and IsModifierPressed("alt")) then
                indexWeapon = 6
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n FAMAS")
            end
            if (arg == Wkey[7] and IsModifierPressed("alt")) then
                indexWeapon = 7
                lastIndexWeapon = indexWeapon
                OutputLogMessage("\n AUG")
            end
            Sleep(100)
        end
        Move()
        OutputLogMessage("\nMOUSE_BUTTON_PRESSED END")

    end
end

lastWeaponType = nil
currentWeaponType = nil

function SyncCurrentWeapon()
    if IsModifierPressed('1') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 1
        return
    end
    if IsModifierPressed('2') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 2
        return
    end
    if IsModifierPressed('3') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 3
        return
    end
    if IsModifierPressed('4') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 4
        return
    end
    if IsModifierPressed('9') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 9
        return
    end
    if IsModifierPressed('0') then
        lastIndexWeapon = currentWeaponType
        currentWeaponType = 0
        return
    end
    if (IsModifierPressed('q')) then
        tmp = lastWeaponType
        lastWeaponType = currentWeaponType
        currentWeaponType = tmp
        return
    end
end

function Move()
    OutputLogMessage("\nMove")
    -- SyncCurrentWeapon()
    -- if currentWeaponType == 3 then
    --     PressAndReleaseKey("f")
    -- end
    while IsMouseButtonPressed(1) and activate == 1 do
        ClearLog()
        OutputLogMessage("\nwhile")
        if (indexWeapon == 17) then
            SetMKeyState(3)
            OutputLogMessage("\n break")
            break
        end
        if (indexWeapon > 0 and indexWeapon < 17) then
            if indexPattern < #Wpattern[indexWeapon] then
                if indexPattern == 1 then
                    timestart = GetRunningTime()
                end
                MoveMouseRelative(Wpattern[indexWeapon][indexPattern].x, Wpattern[indexWeapon][indexPattern].y)
                timestart = timestart + Wpattern[indexWeapon][indexPattern].d
                Sleep3(timestart)
                indexPattern = indexPattern + 1
            else
                ClearLog()
                OutputLogMessage("\n end")
                --activate = 0
            end
        end
    end
end
function Sleep3(time)
    while (time > GetRunningTime())
    do
    end
end